 SET character_set_client = utf8mb4 ;
CREATE TABLE `empleado` (
  `idEmpleado` char(8) NOT NULL,
  `dni` char(8) NOT NULL,
  `nombres` varchar(45) NOT NULL,
  `apellidos` varchar(45) NOT NULL,
  `fechaNacimiento` date NOT NULL,
  `direccion` varchar(100) NOT NULL,
  `email` varchar(45) DEFAULT NULL,
  `telefono` varchar(12) DEFAULT NULL,
  `fechaContratacion` date NOT NULL,
  `usuario` varchar(45) NOT NULL,
  `password` varchar(45) NOT NULL,
  `foto` longblob,
  `idSexo` char(3) NOT NULL,
  `idCargo` char(6) NOT NULL,
  `idDistrito` char(4) NOT NULL,
  PRIMARY KEY (`idEmpleado`),
  UNIQUE KEY `dni_UNIQUE` (`dni`),
  UNIQUE KEY `email_UNIQUE` (`email`),
  KEY `fk_empleado_sexo_idx` (`idSexo`),
  KEY `fk_empleado_cargo1_idx` (`idCargo`),
  KEY `fk_empleado_distrito1_idx` (`idDistrito`),
  CONSTRAINT `fk_empleado_cargo1` FOREIGN KEY (`idCargo`) REFERENCES `cargo` (`idCargo`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empleado_distrito1` FOREIGN KEY (`idDistrito`) REFERENCES `distrito` (`idDistrito`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empleado_sexo` FOREIGN KEY (`idSexo`) REFERENCES `sexo` (`idSexo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
